    Generator Plot




    Tidak disimpan Jump untuk pilihan untuk berbagi, berkomentar dan suara.

    Lahan Obfus Curr

    Kisah Pendek

    oleh Jim

    Obfus Curr melihat pisau aneh di tangannya dan merasa takut.

    Dia berjalan-jalan ke jendela dan tercermin di lingkungan yang indah. Dia selalu
    mencintai gambaran Falmouth dengan gangguannya, dizzy ditches. Ini adalah tempat
    yang mendorong kecenderungannya untuk merasakan takut.

    Kemudian dia melihat sesuatu di jarak, atau lebih dari seseorang. Ambien Cain
    Ambien adalah gajah yang penuh kasih dengan kutil dan bulu mata yang indah.

    Obfus gulped. Diasingkan pada refleksinya sendiri. Dia adalah lapar, kever, wine
    drinker dengan kutil tampan dan bulu mata coklat. Teman-temannya melihat dia sebagai
    berbaris, liar berpasir. Setelah itu, ia bahkan telah menghidupkan kembali unggas
    yang terluka. Tapi bahkan orang lapar yang pernah bertahan, unggas yang terluka,
    disiapkan untuk apa yang Ambien telah menyimpan hari ini. Hujan palu seperti unggas
    humming, membuat ambivalent Obfus.

    Sebagai Obfus melangkah di luar dan Ambien datang lebih dekat, dia bisa melihat
    senyum memurnikan wajahnya.

    "Saya di sini karena saya ingin keadilan", Ambien dibellowed, dalam nada manis.
    Dia menjengkelkan fistnya melawan dada Obfus, dengan kekuatan botol biru 5874.
    "Saya menggoreng cinta Anda, Obfus Curr".

    Obfus terlihat kembali, bahkan lebih ambivalent dan masih memikat pisau aneh.
    "Ambien, saya tidak memiliki uang", dia menjawab. Meme it

    Mereka melihat satu sama lain dengan perasaan aktif, seperti dua maggot tanpa
    gerak, maggot megah tertawa di mitzvah bar yang sangat mempertimbangkan, yang
    memiliki musik klasik bermain di latar belakang dan dua paman caring yang berpikir
    untuk mengalahkan.

    Obfus belajar kutil lebar Ambien dan bulu mata yang indah. Akhirnya, dia mengambil
    napas dalam. "Aku maaf, tapi aku tidak bisa memberimu keadilan", ia menjelaskan,
    dalam nada kemiskinan.

    Ambien terlihat marah, mentah tubuhnya seperti peta yang mungkin, modern.

    Obfus benar-benar bisa mendengar tubuh Ambien hancur menjadi potongan 3833. Kemudian
    gajah yang penuh kasih terburu-buru ke dalam jarak. Tidak bahkan segelas anggur
    akan menenangkan saraf Obfus bermalam.

    Login


    Untuk alasan privasi, penciptaan Anda akan dihapus dari web di 8:30am BST dan
    kemudian dihapus dari server kami, kecuali Anda memilih untuk mempublikasikannya.

    Sitemap





    (Pengcipian yang dipublikasikan tersedia untuk setiap orang dengan tautan.) Voting
    dan komentar hanya tersedia pada pekerjaan yang diterbitkan.

    Auto Praise untuk Hungry Obfus Curr

    "Saya merasa seperti aku tahu Obfus Curr. Dalam cara, rasanya seolah-olah aku
    selalu tahu dia.

    - Kisah Harian

    "Tentang senikmati berdarah sambil mengonsumsi sementara dalam mencuci yang telah
    ditargetkan oleh kelautan laut dengan kesibukan". Login

    "Saying hujan palu seperti unggas humming yang bouncing hanya jenis perangkat
    sastra yang membuat brilian ini".

    - Menekan Spoof

    "Saya bisa melakukan lebih baik".

    - Zob Gloop



